"\tprintf '\\033[%sm' \"$codes\"","}","wrap_color() {","\ttext=\"$1\"","\tshift","\tcolor \"$@\"","\tprintf '%s' \"$text\"","\tcolor reset","\techo","}","","wrap_good() {","\techo \"$(wrap_color \"$1\" white): $(wrap_color \"$2\" green)\"","}","wrap_bad() {","\techo \"$(wrap_color \"$1\" bold): $(wrap_color \"$2\" bold red)\"","}","wrap_warning() {","\twrap_color >&2 \"$*\" red","}","","check_flag() {","\tif is_set_in_kernel \"$1\"; then","\t\twrap_good \"CONFIG_$1\" 'enabled'","\telif is_set_as_module \"$1\"; then","\t\twrap_good \"CONFIG_$1\" 'enabled (as module)'","\telse","\t\twrap_bad \"CONFIG_$1\" 'missing'","\t\tEXITCODE=1","\tfi","}","","check_flags() {","\tfor flag in \"$@\"; do","\t\tprintf -- '- '","\t\tcheck_flag \"$flag\"","\tdone","}","","check_command() {","\tif command -v \"$1\" > /dev/null 2>&1; then","\t\twrap_good \"$1 command\" 'available'","\telse","\t\twrap_bad \"$1 command\" 'missing'","\t\tEXITCODE=1","\tfi","}","","check_device() {","\tif [ -c \"$1\" ]; then","\t\twrap_good \"$1\" 'present'","\telse","\t\twrap_bad \"$1\" 'missing'","\t\tEXITCODE=1","\tfi","}","","check_distro_userns() {","\tif [ ! -e /etc/os-release ]; then","\t\treturn","\tfi","\t. /etc/os-release 2> /dev/null || /bin/true","\tcase \"$ID\" in","\t\tcentos | rhel)","\t\t\tcase \"$VERSION_ID\" in","\t\t\t\t7*)","\t\t\t\t\t# this is a CentOS7 or RHEL7 system","\t\t\t\t\tgrep -q 'user_namespace.enable=1' /proc/cmdline || {","\t\t\t\t\t\t# no user namespace support enabled","\t\t\t\t\t\twrap_bad \"  (RHEL7/CentOS7\" \"User namespaces disabled; add 'user_namespace.enable=1' to boot command line)\"","\t\t\t\t\t\tEXITCODE=1","\t\t\t\t\t}","\t\t\t\t\t;;","\t\t\tesac","\t\t\t;;","\tesac","}","","if [ ! -e \"$CONFIG\" ]; then","\twrap_warning \"warning: $CONFIG does not exist, searching other paths for kernel config ...\"","\tfor tryConfig in $possibleConfigs; do","\t\tif [ -e \"$tryConfig\" ]; then","\t\t\tCONFIG=\"$tryConfig\"","\t\t\tbreak","\t\tfi","\tdone","\tif [ ! -e \"$CONFIG\